webpackJsonp([0xc3df737f93c1],{2478:function(e,t){e.exports={data:{markdownRemark:{html:'<p><strong>A</strong></p>\n<p>Today is the swimming day of lessons. Today is a test day for promoting from the sixth grade.</p>\n<p>"Even if it\'s painful today, I will go through even if I get drowned."</p>\n<p>I made up my mind, but in practice I went three times at the breaststroke 25 meters.</p>\n<p>"I am worried - I\'m a bit worried, but it will be a little bit painful and I will try hard any matter what I feel like drowning, I will absolutely pass and become fifth grade"</p>\n<p>Once we had decided our resolve once again, it became the time of the exam and the order came round to me in no time.</p>\n<p>"Yo, why!"</p>\n<p>When the coach roared up, my friends who were next to me started swimming all at once. I also swam without losing.</p>\n<p>I was the most resuming of the results. However, I finally went swimming without breaking the 25 - meter breaststroke.</p>\n<p>"This will pass"</p>\n<p>I felt a certain response.</p>\n<p>"All the six classes are disqualified"</p>\n<p>But the coach was a demon. I was disappointed, but I was able to produce a fruitful result saying I had swam at the breaststroke 25 meters.</p>',frontmatter:{cover:null,date:"1991-10-29T21:00:00+09:00",strDate:"1991/10/29",title:"diary"}}},pathContext:{path:"/en/blog/1991/10/29-diary/",langKey:"en"}}}});
